function Home() {
  return (
    <div class="toolContainer">
      <div class="leftSide">
        <div class="leftHeader">
          <h2>Circuits for Area 6</h2>
        </div>
        <div class="leftBody">
          <div id="spreadsheet"></div>
        </div>
        <div class="leftFooter">
          <h3>Export</h3>
          <h3>Import</h3>
        </div>
      </div>
      <div class="rightSide"></div>
    </div>
  );
}

export default Home;
